import React, { useEffect, useState } from 'react';
import RankingListItem from './RankingListItem';

function RankingList() {

    const STREAMERS = [{ streamerName: "TFBlade", accountName: "TF Bladeee" }, {}];

    const [streamerData, setStreamerData] = useState([]);

    const StreamerData = class {
        streamerName = "";
        accountName = "";
        rankName = "";
        rankNumber = "";
        totalWins = 0;
        totalLosses = 0;
        constructor(streamerName, accountName, rankName, rankNumber, totalWins, totalLosses) {
            this.streamerName = streamerName;
            this.accountName = accountName;
            this.rankName = rankName;
            this.rankNumber = rankNumber;
            this.totalWins = totalWins;
            this.totalLosses = totalLosses;
        }
    }

    useEffect(() => {
        //to do: scrape account data from opgg for each streamer in STREAMERS

        //for now some sample data:
        let exampleData = [new StreamerData("TF Blade", "TF Bladeee", "Challenger", 1, 200, 200)];
        setStreamerData(exampleData.sort((a, b) => { return a.rankNumber < b.rankNumber ? true : false }));

    }, []);

    useEffect(() => {
        console.log("streamer data updated")
    }, [streamerData]);

    return (
        <div className="RankingList">
            <div className='RankingListHeader'><div>Streamer</div><div>League Account</div><div>Rank</div><div>Ladder Rank</div><div>Wins</div><div>Losses</div></div>
            {
                streamerData.forEach(streamer => {
                    return <RankingListItem streamerName={streamer.streamerName} accountName={streamer.accountName}
                        rankName={streamer.rankName} rankNumber={streamer.rankNumber} totalWins={streamer.totalWins} totalLosses={streamer.totalLosses}></RankingListItem>
                })
            }
        </div>
    );
}

export default RankingList;
